%md
_______________________________________________________________________________________________________________________________________________________________________________
Copy the model dump file from the Object Storage Bucket to the Autonomous Database data pump directory, and then import the model to the database. In SQL Developer, the OML ADMIN must grant the OML user read and write access to the data pump directory. The OML user also requires sevaral text policy grants to work with the model. 

In this example, the OML user is *OMLUSER*.

    GRANT read, write ON DIRECTORY DATA_PUMP_DIR TO OMLUSER;
    GRANT EXECUTE ON CTXSYS.CTX_DDL TO OMLUSER;
    GRANT EXECUTE ON CTXSYS.CTX_OUTPUT TO OMLUSER;
    GRANT EXECUTE ON CTXSYS.CTX_THES TO OMLUSER;
    GRANT EXECUTE ON CTXSYS.CTX_ULEXER TO OMLUSER;

%script

BEGIN
    DBMS_DATA_MINING.DROP_MODEL('WIKI_MODEL', TRUE);
END;

BEGIN
    DBMS_DATA_MINING.IMPORT_MODEL(
        filename => 'wiki_model19.0.0.0.0.dmp',
        directory =>'DATA_PUMP_DIR',
        schema_remap => 'DMUSER:OMLUSER');
END;

%script

BEGIN
    ctx_ddl.DROP_POLICY('wiki_txtpol');
    ctx_ddl.DROP_PREFERENCE( 'wiki_lexer');
  EXCEPTION WHEN OTHERS THEN NULL;
END;

%script

exec ctx_ddl.CREATE_PREFERENCE('wiki_lexer', 'BASIC_LEXER'); 
exec ctx_ddl.SET_ATTRIBUTE('wiki_lexer', 'INDEX_STEMS', 'ENGLISH');
exec ctx_ddl.CREATE_POLICY(policy_name => 'wiki_txtpol', lexer => 'wiki_lexer');
